NeuralNetwork* network_create(int input, int hidden, int output, double lr) {
	NeuralNetwork* net = cortos_bget(sizeof(NeuralNetwork));
	net->input = input;
	net->hidden = hidden;
	net->output = output;
	net->learning_rate = lr;
	Matrix* hidden_layer = matrix_create(hidden, input);
	Matrix* output_layer = matrix_create(output, hidden);
	matrix_randomize(hidden_layer, hidden);
	matrix_randomize(output_layer, output);
	net->hidden_weights = hidden_layer;
	net->output_weights = output_layer;
	return net;
}

Matrix* network_predict_img(NeuralNetwork* net, Img* img) {
	//cortos_printf("predict for single called \n");
	Matrix* img_data = matrix_flatten(img->img_data, 0);
	Matrix* res = network_predict(net, img_data);
	matrix_free(img_data);
	//cortos_printf("predict simgle completed\n");
	return res;
}

double network_predict_imgs(NeuralNetwork* net, Img** imgs, int n) {
	int n_correct = 0;
	int i ;
	//cortos_printf("network prediction called \n");
	for ( i = 0; i < n; i++) {
		//cortos_printf("NPI INSIDE LOOP %d\n", n);
		Matrix* prediction = network_predict_img(net, imgs[i]);
		int p = matrix_argmax(prediction);
		//cortos_printf("predicted from net %d and correct is %d \n", p, imgs[i]->label);
		if (p == imgs[i]->label) {
			n_correct++;
		}
		matrix_free(prediction);
	}
	//cortos_printf("prediction completed %d \n", n_correct);
	return 1.0 * n_correct / n;
}

Matrix* network_predict(NeuralNetwork* net, Matrix* input_data) {

	Matrix* hidden_inputs	= dot(net->hidden_weights, input_data);
	Matrix* hidden_outputs  = apply(sigmoid, hidden_inputs);
	Matrix* final_inputs    = dot(net->output_weights, hidden_outputs);
	Matrix* result          = softmax(final_inputs);

	matrix_free(hidden_inputs);
	matrix_free(hidden_outputs);
	matrix_free(final_inputs);

	return result;
}

NeuralNetwork* network_load_from_C() {
	NeuralNetwork* net = cortos_bget(sizeof(NeuralNetwork));

	net->input = INPUT;
	net->hidden = HIDDEN;
	net->output = OUT;
	net->bias_1 = matrix_load_from_C(HIDDEN, 1, BIAS1);
	//cortos_printf("1 \n");
	net->bias_2 = matrix_load_from_C(OUT, 1, BIAS2);//cortos_printf("2 \n");
	net->hidden_weights = matrix_load_from_C(HIDDEN, INPUT, LAYER1);//cortos_printf("3 \n");
	net->output_weights = matrix_load_from_C(OUT, HIDDEN, LAYER2);//cortos_printf("4 \n");
	return net;
}

void network_print(NeuralNetwork* net) {
	cortos_printf("# of Inputs: %d\n", net->input);
	cortos_printf("# of Hidden: %d\n", net->hidden);
	cortos_printf("# of Output: %d\n", net->output);
	cortos_printf("Hidden Weights: \n");
	matrix_print(net->hidden_weights);
	cortos_printf("Output Weights: \n");
	matrix_print(net->output_weights);
}

void network_free(NeuralNetwork *net) {
	matrix_free(net->hidden_weights);
	matrix_free(net->output_weights);
	cortos_brel(net);
	//net = NULL;
}